</SCRIPT><TABLE width="80%" align="center"><TR><TD align="left"><DIV class="dictionary"><H1><a href="unpassable" title="[59067] 10 ">unpassable</a></H1><SPAN><p><b>UNP'ASSABLE,</b> a.  <p><DD>1.  Not admitting persons to pass; impassable; as unpassable roads, rivers or mountains.  [Impassable is more generally used.]<p><DD>2.  Not current; not received in common payments; as unpassable notes or coins.  [Instead of this, uncurrent and not current are now used.]</SPAN></DIV></TD></TR></TABLE><HR /><BR /><BR /><BR /><BR /><BR ><BR /><BR /><BR /><BR /><BR >
